var CANVAS_WIDTH = 100;
var CANVAS_HEIGHT = 55;

var gCanvas = null;
var gFontData = "data:font/opentype;charset=utf-8;base64,";

window.addEventListener("load", function() {
	setup();
	
	var ctx = gCanvas.getContext("2d");

	draw(ctx);
});

function draw(ctx) {	
	ctx.fillStyle = "#000";
	ctx.fillRect(0, 0, CANVAS_WIDTH, CANVAS_HEIGHT);

	setTimeout(function() {
		ctx.font = "22px CanvasFont-Data";
		ctx.fillStyle = "#0f0";
		ctx.fillText("DATA", 0, 22);

		ctx.font = "22px CanvasFont-Url";
		ctx.fillStyle = "#0f0";
		ctx.fillText("URL", 0, 44);
	}, 500);
}

function setup() {
	gCanvas = document.createElement("canvas");
	gCanvas.width = CANVAS_WIDTH;
	gCanvas.height = CANVAS_HEIGHT;

	document.body.appendChild(gCanvas);
	document.body.style.backgroundColor = "#fff";

	var styleSheet = document.styleSheets && document.styleSheets[0];

	if(!styleSheet)
		throw new Error("Unable to find a document stylesheet.");

	styleSheet.insertRule("@font-face { font-family: CanvasFont-Data; src: url('" + gFontData + "'); }", styleSheet.cssRules.length);
	styleSheet.insertRule("@font-face { font-family: CanvasFont-Url; src: url('../../../resources/fonts/GOTHMBOL.TTF'); }", styleSheet.cssRules.length);

	var ctx = gCanvas.getContext("2d");
	ctx.clearRect(0, 0, CANVAS_WIDTH, CANVAS_HEIGHT);
}